import React from 'react'
import jsonData from '../../../../json_books.json'

const MyBook = React.forwardRef((props, ref) => {
  const firstItem = jsonData[2]; // Accede al primer objeto del JSON

  return (
    <div className='demoPage' ref={ref}>
          <p>Title: {firstItem.Title}</p>
          <p>Synopsis: {firstItem.Synopsis}</p>
          <div className='Container'>
            <iframe
              className='Iframe'
              title={`Iframe for ${firstItem.Title}`}
              src={firstItem.Flipbook}
              seamless="seamless"
              allowFullScreen="true"
            ></iframe>
        </div>
    </div>
  );
});

export default MyBook
